Chronische Schmerzen können verschiedene Ursachen haben. Sie können durch Bewegungen, enge Kleidung oder Essen schlimmer werden. Der Schmerz kann sich anders anfühlen. Er kann krampfartig, stechend oder schneidend sein. 

